const Product = () => {
  return (
    <>
      <Card>
        <Image
          width="100%"
          height="100%"
          src="https://i.ibb.co/R70vBrQ/men.png"
          rounded
        />
        <p class="lead" style={{color:"purple"}}>
          This is a title
        </p>
      </Card>
    </>
  );
};

export default Product;
